import React from 'react';

const Home = () => {
  return (
    <div className="ml-64 p-6">
      <h2 className="text-2xl font-semibold">Dashboard Overview</h2>
      <p className="mt-2 text-gray-600">Welcome to the FCI MIS Dashboard.</p>
    </div>
  );
};

export default Home;
